pragma solidity ^0.8.9;

contract Todo {
    struct Task {
    uint id;
    uint date;
    string content;
    string author;
    bool done;
    uint dateComplete;
    }
    mapping(uint => Task) public tasks;
    uint nextTaskId;

    event TaskCreated(
        uint id,
        uint date,
        string content,
        string author,
        bool done
    );
    event TaskStatusToggled(
        uint id, 
        bool done, 
        uint date
    );

    function createTask(
        string memory _content, 
        string memory _author) 
        external {
        tasks[nextTaskId] = Task(nextTaskId, block.timestamp, _content, _author, false, 0);
        emit TaskCreated(nextTaskId, block.timestamp, _content, _author, false);
        nextTaskId++;
    }

    //Original function (does not work because of web3)
    function getTasks() external view returns(Task[] memory) {
    Task[] memory _tasks = new Task[](nextTaskId);
    for(uint i = 0; i < nextTaskId; i++) {
        _tasks[i] = tasks[i];
    }
    return _tasks;
    }

  //Work-around
//   function getTasks()
//     external
//     view
//     returns(
//       uint[] memory, 
//       uint[] memory, 
//       bytes32[] memory,
//       bytes32[] memory,
//       bool[] memory,
//       uint[] memory
//     ) {
//     uint[] memory ids = new uint[](lastTaskId);
//     uint[] memory dates = new uint[](lastTaskId);
//     bytes32[] memory contents = new bytes32[](lastTaskId);
//     bytes32[] memory authors = new bytes32[](lastTaskId);
//     bool[] memory dones = new bool[](lastTaskId);
//     uint[] memory dateCompletes = new uint[](lastTaskId);
//     for(uint i = 0; i < lastTaskId; i++) {
//       ids[i] = tasks[i].id;
//       dates[i] = tasks[i].date;
//       contents[i] = tasks[i].content;
//       authors[i] = tasks[i].author;
//       dones[i] = tasks[i].done; 
//       dateCompletes[i] = tasks[i].dateComplete;
//     }
//     return (ids, dates, contents, authors, dones, dateCompletes);
//   }

    function toggleDone(uint id) external {
        require(tasks[id].date == 0);
        Task storage task = tasks[id];
        task.done = !task.done;
        task.dateComplete = task.done ? block.timestamp : 0;
        emit TaskStatusToggled(id, task.done, task.dateComplete);
    }

    // modifier taskExists(uint id) {
    //     if(tasks[id].date == 0) {
    //     revert();
    //     }
    //     _;
    // }
}

